class VDOM_colorpicker(VDOM_object):

	def render(self, parent, contents=""):
		clean_id = (self.id).replace('-', '_')
		id = 'o_' + clean_id
		if self.visible == "1":
			vis=""
		else:
			vis="display:none;"
		style = "%s z-index: %s;position: absolute;top: %spx;left: %spx;width: %spx;height: %spx;cursor:pointer;background: #%s;"%(vis, self.zindex, self.top, self.left, self.width, self.height, self.color)
#		contents = """<script type="text/javascript">attachColorPicker('%s');</script>"""%(id)
		contents = ""
		result = "<div id=\"%s\" style=\"%s\"><span style='display:none'>%s</span></div>%s"%(id, style, self.color, contents)
		result += """<script type="text/javascript">if(jQuery.inArray('"""+id+"""',document.attachCP)<0){
document.attachCP.length++;document.attachCP[document.attachCP.length-1]='"""+id+"""';
var cp=jQuery('#"""+id+"""');
cp.colorpickered = true;
cp.ColorPicker({onShow:function(cp){jQuery(cp).css('z-index',9999).fadeIn(100);return false;},onSubmit:function(hsb,hex,rgb){jQuery('#"""+id+"""').css('backgroundColor','#'+hex);execEventBinded('"""+clean_id+"""','changecolor',{color:'#'+hex});jQuery('#"""+id+""">span').text('#'+hex);jQuery('#"""+id+"""').ColorPickerHidePicker();}});
cp.ColorPickerSetColor('#'+cp.find('span').text());
}</script>""";

		return VDOM_object.render(self, parent, contents=result)


	def wysiwyg(self, parent, contents=""):
		result=""\
			"<container id=\"%s\" visible=\"%s\" zindex=\"%s\" hierarchy=\"%s\" order=\"%s\" top=\"%s\" left=\"%s\" width=\"%s\" height=\"%s\">"\
				"<svg>"\
					"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"%s\" fill=\"#%s\"/>"\
				"</svg>"\
				"%s"\
			"</container>"%(
				self.id, self.visible, self.zindex, self.hierarchy, self.order,	self.top, self.left, self.width, self.height,
				0, 0, self.width, self.height, self.color,
				contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)
